import React from 'react'
import { useParams } from 'react-router-dom';


const Info = () => {
  const { login } = useParams();
  // the rest of your logic
  const userInfo = [];
  const request = fetch(`https://api.github.com/users/${login}`)
  .then(response => {
      return response.json();
  })
  .then(data => {
      userInfo.push(data);
  });
    
  console.log(userInfo["0"])

  return null;
}

export default Info
